import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './Appold';
import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter as Router, Switch, Route, Routes } from "react-router-dom";
import Header from './components/Header'

import CreateSession from './components/CreateSession';
import ShowActiveSession from './components/ShowActiveSession';
import TerminateActiveSession from './components/TerminateActiveSession';
import ShowAllUsers from './components/ShowAllUsers';
import ShowSessionUser from './components/ShowSessionUser';
import AddUser from './components/AddUser';
import AddRestaurant from './components/AddRestaurant';
import ShowSelectedRestaurant from './components/ShowSelectedRestaurant';

import { createRoot } from 'react-dom/client';
const container = document.getElementById('root');
const root = createRoot(container); 

root.render(
  <React.StrictMode>
       <Router>
      <Header/>
      <Routes>       
        <Route path="/" element={<App />}></Route>
        <Route path="/showActiveSession" element={<AddUser />}></Route>
        <Route path="/terminateActiveSession" element={<ShowAllUsers />}></Route>   
        <Route path="/showAllUsers" element={<ShowAllUsers />}></Route>   
        <Route path="/showSessionUser" element={<ShowAllUsers />}></Route>   
        <Route path="/addUser" element={<ShowAllUsers />}></Route>   
        <Route path="/addRestaurant" element={<ShowAllUsers />}></Route>   
        <Route path="/showSelectedRestaurant" element={<ShowAllUsers />}></Route>   
      </Routes>
    </Router>
  </React.StrictMode>
);
